    false,nt"url": null,nt"notes": "This annual narrative report for Morton
    National Wildlife Refuge outlines Refuge accomplishments for the 1981 calendar year.
    The report begins with Refuge highlights and describes climate and habitat conditions,
    and system status. Refuge construction, maintenance, and wildfires are also described.
    Habitat management is covered; grasslands, wetlands, prescribed fire, pest control,
    and wilderness and special areas are discussed. The wildlife section of the report
    discusses wildlife diversity, endangered and threatened species, migratory birds,
    mammals, animal control, and big game animals. Interpretation and recreation activities
    are outlined; topics include information and interpretation, recreational uses,
    and law enforcement. The equipment and facilities section discusses new construction,
    maintenance, equipment utilization and replacement, and energy conservation. Cooperative
    programs, items of interest, and safety are discussed. Photographs are attached.",nt"license_title":
